import React from "react";
import "./App.css";
import { useState } from "react";
import Box from "@mui/material/Box";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { CardActionArea, CardActions } from "@mui/material";
import { useSelector, useDispatch } from "react-redux";
import { serviceData } from "./dataReducer";

export default function Dashboard() {
  const [service, setService] = useState("Plumber");
  const count = useSelector((state) => state.service.data);
  const dispatch = useDispatch();

  const handleChange = (event) => {
    setService(event.target.value);
  };

  const handleClick = () => {
    const temp = JSON.parse(localStorage.getItem(service));
    dispatch(serviceData(temp));

    console.log(count);
  };

  return (
    <div>
      <div id="form2">
        <Box sx={{ maxWidth: 320, marginLeft: 96 }}>
          <FormControl fullWidth>
            <InputLabel id="demo-simple-select-label">
              Select Service
            </InputLabel>
            <Select
              labelId="demo-simple-select-label"
              id="demo-simple-select"
              value={service}
              label="Select Service"
              onChange={handleChange}
            >
              <MenuItem value={"Plumber"}>Plumber</MenuItem>
              <MenuItem value={"Electrician"}>Electrician</MenuItem>
              <MenuItem value={"Carpenters"}>Carpenters</MenuItem>
            </Select>
          </FormControl>
        </Box>
        <Button onClick={handleClick} variant="outlined">
          Search
        </Button>
        <h1>{count.name}</h1>
      </div>
      <br />

      {/* {data.map((item, index) => {
        return (
          <Card
            key={index}
            sx={{
              float: "left",
              p: 4,
              m: 6,
              bgcolor: "background.paper",
              maxWidth: 300,
              borderRadius: 1,
            }}
          >
            <CardActionArea>
              <CardContent>
                <Typography gutterBottom variant="h5" component="div">
                  Name : {item.name}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  Price : {item.price}
                </Typography>
              </CardContent>
            </CardActionArea>
            <CardActions>
              <Button size="small" color="primary">
                Contact
              </Button>
            </CardActions>
          </Card>
        );
      })} */}
    </div>
  );
}
